  input: TEXT,F3XA,,"Note (1) - Line 15 reports $6,607.86 in refunds and rebates of
    expenses. These were refunds of allocable expenses and, accordingly, the non-Federal
    share of these refunds was 78% of the total, or $5,154.1O. This non-Federal share
    was transfered to our non-Federal account 11/26/02 and  was reported as such on
    Sch H4/Line 21a of our 12/31/02 year-end report.   Note (2) - Line 11c reports
    contributions from DASH-PAC in the aggregate amount of $10,000. Together with
    $500 received 7/10/02, we received excess contributions of $5,500 from this donor.
    Accordingly, we have refunded this excess contribution on 6/25/03 and will report
    this refund on Line 28c of our mid-year report.   Note (3) - Receipts reported
    on Line 15 include reimbursement for goods or services provided. All charges for
    goods were at our cost. All goods for services (rent of office space) were for
    the pro-rata portion of our rent expense, based upon the square footage occupied
    by the committees. Such charges were usual and normal charges at fair market values.
    Accordingly they should not be considered as contributions by this committee or
    to the committees who made these payments.  Note (4) - None of the transfers-in
    from our national party organizations, reported on Line 12, were for the purpose
    of paying for any exempt activities related to a federal candidate, nor were they
    used for such purpose."
